import React from "react";
import classnames from "classnames";
import { Nav, NavItem, NavLink } from "reactstrap";

const MyTabNav = (props) => {
  return (
    <div aria-label="myTabPane">
      <main>
        <TabContent activeTab={activeTab}>
        <TabPane tabId={String(activeTab)}>
          <Row>
            {projectMap[projectNames[activeTab]].map((note, i) => (
              <NoteCard key={activeTab + i} noteObject={note} />
            ))}
          </Row>
        </TabPane>
      </TabContent>
        <Nav tabs>
          {props.projectNames.map((project, i) => (
            <NavItem key={i} className="font-weight-bold">
              <NavLink
                className={classnames({
                  active:
                    props.activeTab ===
                    String(props.projectNames.indexOf(project)),
                })}
                onClick={() => {
                  props.toggle(String(props.projectNames.indexOf(project)));
                }}
              >
                {project}
              </NavLink>
            </NavItem>
          ))}
        </Nav>
      </main>
    </div>
  );
};

export default MyTabNav;
